from collections import deque

class Solution:
    """
    @param matrix: A 2D-array of integers
    @return: an integer
    """
    def longestContinuousIncreasingSubsequence2(self, matrix):

        # write your code here
        row = len(matrix)
        if not matrix:
            return 0
        if not matrix[0]:
            return 0
        col = len(matrix[0])
        max_distance = 0
        directions = [(0,1),(1,0),(-1, 0),(0, -1)]
        dp  = [[-1] * col for _ in range(row)]
        for i in range(row):
            for j in range(col):
                for d in directions:
                    x = i + d[0]
                    y = j + d[1]
                    if 0 <= x < row and 0 <= y < col:
                        distance = self.dfs(matrix, dp, i, j)
                        max_distance = max(distance, max_distance)
        return max_distance + 1

    def dfs(self, matrix, dp, i, j):
        if dp[i][j] != -1:
            return dp[i][j]
        directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
        max_distance = 0
        row, col = len(matrix), len(matrix[0])
        for d in directions:
            x = i + d[0]
            y = j + d[1]
            if 0 <= x < row and 0 <= y < col:
                if matrix[x][y] > matrix[i][j]:
                    curr_distance = self.dfs(matrix, dp, x, y) + 1
                    max_distance = max(curr_distance, max_distance)
        dp[i][j] = max_distance

        return max_distance



